 Sure, here is an example of how you can server a ReactJS app from a simple ExpressJS server in TypeScript:

First, you will need to set up your ExpressJS app in your `server.ts` file like this:
```typescript
import express from 'express';
import { buildUserLayout } from './views/UserLayout';

const app = express();

app.use('/', buildUserLayout);

app.listen(3000, () => {
  console.log('Server listening on port 3000');
});
```
This will simply set up an ExpressJS server on port 3000 that serves the HTML content generated by the `buildUserLayout` function, which is defined in the `views/UserLayout.tsx` file.

Next, you will need to create your ReactJS app in your `src/index.tsx` file like this:
```typescript
import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
```
This will simply render the ReactJS app in the HTML document and use the `root` element as the container.

